"app_info" : "Soft Token – VietinBank OTP is a high security method helping to create OTP for online authentication with numerous outstanding advantages: 

Safer: VietinBank OTP is the most secure solution lately, researched by VietinBank associated with the world’s leading security partners, used globally by numerous leading banks. The State Bank of Vietnam announced that every transaction with high value is required to use it. 

More convenient: 
+ Convenient, Hard Tokens are not required, authorize all transactions with 6 digits – VietinBank OTP’s opening application code; 
+ Stable, usable in no Internet conditions, roaming is not necessary while travelling abroad; 
+ Easy to register; 
+ Meet the limitation of type-D transactions (highest value type) according to the State Bank of Vietnam requirement (Decision 630/QD-NHNN)."

"app_info" : "Soft Token - VietinBank OTP là phương thức bảo mật cao, giúp tạo mã OTP để xác thực giao dịch trực tuyến, với nhiều ưu điểm vượt trội: 

An toàn hơn: VietinBank OTP là giải pháp có mức độ bảo mật cao nhất hiện nay, được nghiên cứu bởi VietinBank kết hợp với đối tác bảo mật hàng đầu, được các Ngân Hàng hàng đầu trên thế giới sử dụng và được NHNN yêu cầu bắt buộc sử dụng đối với các giao dịch tài chính cao. 

Tiện lợi hơn: 
+ Tiện lợi, không phải mang theo Hard Token, xác thực mọi giao dịch chỉ cần nhớ 6 số Mã mở ứng dụng VietinBank OTP; 
+ Ổn định, sử dụng được ngay cả khi không có kết nối Internet, không cần roaming khi đi nước ngoài; 
+ Đăng ký dễ dàng; 
+ Đáp ứng hạn mức giao dịch loại D (loại cao nhất) theo yêu cầu của Ngân Hàng Nhà nước (Quyết định số 630/QĐ-NHNN)."
